import React from "react";

const SectionDivider = ({ className = "", color = "currentColor" }) => {
  return (
    <div className={`flex justify-center my-8 ${className}`}>
      <svg
        width="320"
        height="24"
        viewBox="0 0 320 24"
        fill="none"
        xmlns="http://www.w3.org/2000/svg"
        aria-hidden="true"
        style={{ color }}
      >
        <path d="M4 12 H120" stroke="currentColor" strokeWidth="2" strokeLinecap="round"/>
        <path d="M200 12 H316" stroke="currentColor" strokeWidth="2" strokeLinecap="round"/>
        <circle cx="160" cy="12" r="3" fill="currentColor"/>
        <path d="M140 12c8-8 32-8 40 0" stroke="currentColor" strokeWidth="2" fill="none"/>
        <path d="M140 12c8 8 32 8 40 0" stroke="currentColor" strokeWidth="2" fill="none"/>
      </svg>
    </div>
  );
};

export default SectionDivider;
